import React, { useState,useEffect } from 'react';

function ProductList() {
    const [products,setProducts]=useState([]);

    useEffect(()=>{
        getProduct();
    },[])

    const getProduct=async ()=>{
        let result=await fetch('http://localhost:5000/products');
        result=await result.json()
        setProducts(result);
    }
  

  return (
    <>
    <div className='product-list'>
        <h1>Product List</h1>
        <ul>
            <li key="uniqueid1"><h4>Sl.No</h4></li>
            <li key="uniqueid1"><h4>Name</h4></li>
            <li><h4>Price</h4></li>
            <li><h4>Category</h4></li>
            <li><h4>Company</h4></li>
        </ul>
    {
        products.map((item,index)=>
        <ul>
            <li key="uniqueid1">{index+1}</li>
            <li key="uniqueid2">{item.name}</li>
            <li key="uniqueid3">{item.price} /-Rs</li>
            <li key="uniqueid4">{item.category}</li>
            <li key="uniqueid5">{item.company}</li>
        </ul>

        )
    }
    </div>
    </>
  )
}

export default ProductList;
